import React from 'react';
import '../styles/Title.css';

class Title extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
          <div className="header">
              <h1>{this.props.emoji} {this.props.title} {this.props.emoji}</h1>
          </div>
        );
    }
}

export default Title;
